                    cards[j]="";
                }
            }
        }

        bool ok=true;
        for(int i=0;i<cards.size();i++)
        {
            if(cards[i]!="")
            {
                if(trumpCards.empty())
                    ok=false;
                else
                {
                    moves.pb({cards[i],trumpCards.back()});
                    trumpCards.pop_back();
                }
